"""

Given two string print the length of longest common subsequence

"""


def RecurrLCS(s1, s2, n, m):
    if n == 0 or m == 0:
        return 0
    if s1[n-1] == s2[m-1]:
        return 1+RecurrLCS(s1, s2, n-1, m-1)
    else:
        return max(RecurrLCS(s1, s2, n, m-1), RecurrLCS(s1, s2, n-1, m))


# memoization
l = ''
n = len(l)
p = ''
m = len(p)
dp = [[0 for _ in range(n+1)]for _ in range(m+1)]


def MemoizationLCS(s1, s2, n, m):
    if n == 0 or m == 0:
        return 0
    if dp[n][m]:
        return dp[n][m]
    if s1[n-1] == s2[m-1]:
        dp[n][m] = 1+RecurrLCS(s1, s2, n-1, m-1)
        return dp[n][m]
    else:
        dp[n][m] = max(RecurrLCS(s1, s2, n, m-1),
                       RecurrLCS(s1, s2, n-1, m))
        return dp[n][m]


# Dp top down


def DpLCS(s1, s2, n, m):
    for i in range(1, n+1):
        for j in range(1, m+1):
            if s1[i-1] == s2[j-1]:
                dp[i][j] = 1+dp[i-1][j-1]
            else:
                dp[i][j] = max(dp[i-1][j], dp[i][j-1])
    return dp[n][m]


print(DpLCS(l, p, n, m))
